import './EventCard.css'

function EventCard(props) {

    return (  
        <div className="eventcard-container">

            <img src='https://media.harrypotterfanzone.com/philosophers-stone-20-years-of-movie-magic-harry-poster.jpg'/>

            <div className="name">
            Movie name
            </div>
            <div className="date">15th March 2022</div>
            <div className="time">10:50:00</div>
            <div className="time">120 Mins</div>
            
            
            
            

        </div>
    );
}

export default EventCard;
